import React, {Component} from "react";
import '../styles/App.css'

export class EquipmentList extends Component {


    
    render() {
        return(
            <div className='equipment_card'>
                {this.props.items.map(item => (
                    <p key={item.name}>
                        {items.name}
                    </p>
                ))}
            </div>
        )
    }
}
